import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";

export const TopItem = ({ setSelected, sampleData, column }) => {
  const [theme, setTheme] = useContext(ThemeContext);

  return (
    <div
      className={`flex col-span-8 overflow-hidden rounded-lg shadow-lg  text-xs md:text-md w-64 px-8 sm:w-full py-10 mb-5 bg-${
        theme
      }`}
    >
      <div className="w-full">
        <div className="flex justify-center ">
          <table className="table-auto w-full text-center ">
            <thead>
              <tr>
                <th>{column.column1}</th>
                <th>{column.column2}</th>
              </tr>
            </thead>
            <tbody>
              {sampleData.map((item) => (
                <tr key={item.id}>
                  <td className="px-4 py-2">{item.name}</td>
                  <td className="px-4 py-2">{item.type}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};
export default TopItem;
